import React from "react";

function Booknotes() {
  return (
    <div>
      <nav class="navbar bg-light">
        <div class="container-fluid">
          <a class="navbar-brand">BookNotes</a>
          <a href="">cbdh</a>
        </div>
      </nav>
    </div>
  );
}

export default Booknotes;
